import "./app.scss"
import Login from "./component/Login";
import SignUp from "./component/SignUp";
import {Tabs} from "antd";


const tabs =[
{
  key:"login",
  label:"Login",
  children:<h1>Login</h1>
}
,{
    key:"SignUp",
    label:"SignUp",
    children:<h1>SignUp</h1>

},
]



 const App = ()=>{
    return(
        <div className="container">
        <Tabs items={tabs}/>
        </div>
    )
 }
 export default App;
